window.JST['afp_add_afp_share'] = template('<% if (afpShareId!=null) { %>\n<h3>Edit afp export</h3>\n<%} else {%>\n<h3>Add afp export</h3>\n<%}%>\n<div class="row-fluid">\n  <div class="span8">\n    <label class="control-label"></label>\n    <div class="form-box">\n      <form id="add-afp-share-form" name="aform" class="form-horizontal">\n        <div class="messages"></div>\n\n        <!-- Shares -->\n        <div class="control-group">\n          <label class="control-label" for="shares">Shares to export via afp<span class="required">*</span></label>\n          <div class="controls">\n            <select name="shares" id="shares" size="10" class=\'required\' multiple data-placeholder="Select shares" >\n            <% if (afpShareId!=null) {  %>\n            <option value="<%= afpShare.get(\'share\')%>" selected="selected"> <%= afpShare.get(\'share\') %></option>\n            <% } %>\n              <% _.each(shares, function(share, index) { %>\n                <option value="<%= share.get(\'name\') %>"><%= share.get(\'name\') %></option>\n              <% }); %>\n            </select>\n          </div>\n        </div>\n\n        <!-- Time Machine -->\n\n        <div class="control-group">\n          <label class="control-label" for="time_machine">Time Machine<span class="required"> *</span></label>\n          <div class="controls">\n              <% _.each(time_machine_choices, function(c) { %>\n                <label class="radio inline">\n                <% if (afpShareId!=null){ %>\n                    <% if(c.value == afpShare.get("time_machine")){ %>\n                        <input type="radio" name="time_machine" value="<%= c.value %>" title="Enable Time Machine support for this Share to backup Macs." checked> <%= c.name %>\n                    <% }else{ %>\n                        <input type="radio" name="time_machine" value="<%= c.value %>" title="Don\'t enable Time Machine support for this Share." > <%= c.name %>\n                    <% } %>\n                 <% }else { %>\n                   <% if(c.value == \'yes\'){ %>\n                      <input type="radio" name="time_machine" value="<%= c.value %>" title="Enable Time Machine support for this Share to backup Macs" checked> <%= c.name %>\n                   <%  }else{ %>\n                      <input type="radio" name="time_machine" value="<%= c.value %>" title="Don\'t enable Time Machine support for this Share." > <%= c.name %>\n                <%  } %>\n                 <%  } %>\n                </label>\n              <% }); %>\n          </div>\n        </div>\n\n        <!-- Submit -->\n        <div class="control-group">\n          <div class="controls">\n            <a id="cancel" class="btn">Cancel</a>\n            <input type="Submit" id="create-afp-share" class="btn btn-primary" value="Submit"></input>\n          </div>\n        </div>\n\n      </form>\n    </div>\n  </div> <!-- span8 -->\n</div>  <!-- row-fluid -->\n');
window.JST['afp_afp'] = template('<!-- Module Body -->\n<div class="row-fluid">\n  <div class="span12">\n      <div id="details-header">\n      <table>\n        <tr>\n          <td><span class="h3">AFP Service&nbsp;&nbsp;&nbsp;</span></td>\n          <td>\n            <% if (service.get(\'status\')) { %>\n              <div class="slider-stop" data-service-name="<%= service.get(\'name\') %>">OFF</div>\n              <div class="slider-ph">\n                <input type="text" class="service-status" value="1" data-service-name="<%= service.get(\'name\') %>"></input>\n              </div>\n              <div class="slider-start on" data-service-name="<%= service.get(\'name\') %>">ON</div>\n            <% } else { %>\n              <div class="slider-stop" data-service-name="<%= service.get(\'name\') %>">OFF</div>\n              <div class="slider-ph">\n                <input type="text" class="service-status" value="0" data-service-name="<%= service.get(\'name\') %>"></input>\n              </div>\n              <div class="slider-start" data-service-name="<%= service.get(\'name\') %>">ON</div>\n            <% } %>\n            <div class="command-status" data-service-name="<%= service.get(\'name\') %>">&nbsp;</div>\n          </td>\n        </tr>\n      </table>\n    </div>\n    <div id="afp-warning" class="alert" style="display:none">\n    	<strong>Warning! AFP Service is not running</strong>. Clients won\'t be able to mount unless AFP is running.\n    </div>\n    <div class="messages"></div>\n    <!-- Content -->\n    <% if (collection.length > 0) { %>\n      <table id="afp-exports-table" class="table table-condensed table-bordered table-hover table-striped share-table tablesorter" summary="List of afp exports">\n        <thead>\n          <tr>\n            <th scope="col" abbr="Share name">Share</th>\n            <th scope="col" abbr="Time Machine">Time Machine</th>\n            <th scope="col" abbr="Actions">Actions</th>\n          </tr>\n        </thead>\n        <tbody>\n          <% collection.each(function(afpShare) { %>\n            <tr>\n              <td><%= afpShare.get(\'share\') %></td>\n              <td><%= afpShare.get(\'time_machine\') %></td>\n              <td>\n	      <a href="#afp/edit/<%= afpShare.id %>"><i class="icon-pencil"></i></a>\n	      &nbsp;\n                <a href="#" class="delete-afp-share" data-share="<%= afpShare.get(\'share\') %>" data-id="<%= afpShare.id %>"><i class="icon-trash"></i></a>\n              </td>\n            </tr>\n          <% }); %>\n        </tbody>\n      </table>\n    <% } else { %>\n      <table id="afp-exports-table" class="table table-condensed table-bordered table-hover table-striped share-table tablesorter" summary="List of afp exports">\n        <tbody>\n          <tr>\n            <td colspan="5">\n              <h4>No afp exports have been created</h4>\n            </td>\n          </tr>\n        </tbody>\n      </table>\n    <% } %>\n    <% if (freeShares.length > 0) { %>\n      <a href="#add-afp-share" id="add-afp-share" class="btn btn-primary"><i class="icon-edit icon-white"></i> Add afp Export</a>\n    <% } else { %>\n      <a href="#add-afp-share" id="add-afp-share" class="btn btn-primary disabled" title="No shares available to export through afp"><i class="icon-edit icon-white"></i> Add afp Export</a>\n    <% } %>\n  </div>\n</div>\n');
window.JST['appliances_add_appliance'] = template('<h3>Bind to another Rockstor Appliance</h3>\n<div class="row-fluid">\n  <div class="span8">\n    <label class="control-label"></label>\n    <div class="form-box">\n      <form name="add-appliance-form" id="add-appliance-form">\n        <div class="messages"></div>\n        <div class="control-group">\n          <label class="control-label" for="ip">Appliance IP or Hostname<span class="required"> *</span></label>\n          <div class="controls">\n            <input type="text" name="ip" id="ip" title="Enter either the appliance ip address or the appliance hostname that is reachable from this appliance">\n          </div>\n        </div>\n        <div class="control-group">\n          <label class="control-label" for="port">Management Port<span class="required"> *</span></label>\n          <div class="controls">\n            <input type="text" name="mgmt_port" id="mgmt_port" value="443" title="Management Port of the remote appliance">\n          </div>\n        </div>\n        <div class="control-group">\n          <label class="control-label" for="client_id">Access key ID<span class="required"> *</span></label>\n          <div class="controls">\n            <input type="text" name="client_id" id="client_id" title="Access key ID of the remote appliance. You can get this from System -> Access Keys; screen of the remote aplliance web-ui.">\n          </div>\n        </div>\n        <div class="control-group">\n          <label class="control-label" for="password">Access Key Secret<span class="required"> *</span></label>\n          <div class="controls">\n            <input type="password" name="client_secret" id="client_secret" title="Access key Secret of the remote appliance. You can get this from System -> Access Keys; screen of the remote appliance web-ui.">\n          </div>\n          <div class="controls">\n            <a id="js-cancel" class="btn" href="#">Cancel</a>\n            <input type="Submit" id="add-appliance" class="btn btn-primary" value="Submit"></input>\n          </div>\n        </div>\n\n      </form>\n\n    </div>\n  </div> <!-- span8 -->\n</div> <!-- row-fluid -->\n');
window.JST['appliances_appliances'] = template('<!-- appliances -->\n<h3>RockStor Appliances that are known to this one</h3>\n<div class="row-fluid">\n  <div class="span12">\n    <table class="table table-condensed table-bordered table-hover table-striped tablesorter"style="width: 100%">\n      <thead>\n        <tr>\n          <th scope="col" abbr="ID">Appliance ID</th>\n          <th scope="col" abbr="IP">Appliance IP</th>\n          <th scope="col" abbr="IP">Management Port</th>\n          <th scope="col" abbr="Action">Actions</th>\n        </tr>\n      </thead>\n      <tbody>\n      <% collection.each(function(appliance) { %>\n        <tr>\n        <td><%= appliance.get(\'uuid\') %></td>\n          <td>\n            <i class="fa fa-desktop"></i>&nbsp;\n            <% if (appliance.get(\'current_appliance\')) { %>\n              <%= appliance.get(\'ip\') %> <span class="required">*</span>\n            <% } else { %>\n              <a href="https://<%= appliance.get(\'ip\') %>:<%= appliance.get(\'mgmt_port\') %>" target="_blank"><%= appliance.get(\'ip\') %></a>\n            <% } %>\n          </td>\n          <td><%= appliance.get(\'mgmt_port\') %></td>\n          <td>\n            <% if (!appliance.get(\'current_appliance\')) { %>\n              <a class="delete-appliance" id="<%= appliance.get(\'ip\') %>" data-id="<%= appliance.get(\'id\') %>" href="#"><i class="icon-trash"></i></a>\n            <% } %>\n          </td>\n        </tr>\n      <% }); %>\n\n    </table>\n    <div class="pagination-ph"></div>\n    ( <span class="required">*</span> - current appliance )\n  </div> <!-- span12 -->\n</div> <!-- row-fluid -->\n<br>\n<a class="btn btn-primary" id="add-appliance" href="#add-appliance">Add Appliance</button>\n<br>\n<div id="new-appliance-container">\n</div>\n\n');
