window.JST['common_pagination'] = template('<% if (collection.pageInfo().pages > 1) { %>\n \n   <div class="pagination">\n   <% var entries = (collection.pageInfo().page)*collection.pageSize ; \n   if(collection.pageInfo().page*collection.pageSize > collection.pageInfo().count){\n   entries = collection.pageInfo().count;\n   }\n   %>\n    <p><i>Displaying entries <%= (collection.pageInfo().page-1)*collection.pageSize+1 %>  -  <%= entries %>  of  <%= collection.pageInfo().count %></i></p>\n    <ul>\n    \n    <li><a class="go-to-page" href="#" data-page="1"><i class="icon-fast-backward"></i></a></li>\n      <% if (collection.pageInfo().prev) { %>\n        <li><a class="prev-page" href="#"><i class="icon-backward"></i></a></li>\n      <% } else { %>\n        <li class="disabled"><a class="prev-page" href="#"><i class="icon-backward"></i></a></li>\n      <% } %>\n      \n      <% var start = collection.pageInfo().page - 4 ;\n          if(start <= 0){\n          start = 1;\n          }\n         var end = start + 9;\n         if(end > collection.pageInfo().pages){\n         end = collection.pageInfo().pages;\n         }\n         for (var i=start; i<= end; i++) { %> \n        <% if (i == collection.pageInfo().page) { %>\n          <li class="active"><a class="go-to-page" href="#" data-page="<%= i %>"><%= i %></a></li>\n        <% } else { %>\n          <li><a class="go-to-page" href="#" data-page="<%= i %>"><%= i %></a></li>\n        <% } %>\n      <% } %>\n      <% if (collection.pageInfo().next) { %>\n        <li><a class="next-page" href="#"><i class="icon-forward"></i></a></li>\n      <% } else { %>\n        <li class="disabled"><a class="next-page" href="#"><i class="icon-forward"></i></a></li>\n      <% } %>\n      <li><a class="go-to-page" href="#" data-page="<%= collection.pageInfo().pages%>"><i class="icon-fast-forward"></i></a></li>\n    </ul>\n  </div>\n<% } %>\n\n');
