window.JST['disk_disks_table'] = template('<% if (!collection.isEmpty()) { %>\n  <table id="disks-table" class="table table-condensed table-bordered table-hover table-striped share-table tablesorter" summary="List of disks">\n    <thead>\n      <tr>\n        <th scope="col" abbr="Name">Name</th>\n	<th scope="col" abbr="Serial">Serial</th>\n        <th scope="col" abbr="Capacity">Capacity</th>\n        <th scope="col" abbr="Pool">Pool</th>\n	<th scope="col" abbr="Model">Model</th>\n	<th scope="col" abbr="Transport">Transport</th>\n	<th scope="col" abbr="Vendor">Vendor</th>\n      </tr>\n    </thead>\n    <tbody>\n      <% collection.each(function(disk, index) { %>\n        <tr>\n          <td><i class="icon-hdd"></i> <%= disk.get(\'name\') %>&nbsp;\n             <% if (disk.get(\'offline\')) { %>\n              <a href="#" class="delete" data-disk-name="<%= disk.get(\'name\') %>" title="Disk is unusable because it is offline. Click to delete it from the system" rel="tooltip"><i class="icon-trash"></i></a>\n            <% } else if (disk.get(\'parted\')) { %>\n              <a href="#" class="wipe" data-disk-name="<%= disk.get(\'name\') %>" title="Disk is unusable because it has partitions. Click to wipe the disk" rel="tooltip"><i class="icon-cog"></i></a>\n            <% } else if (disk.get(\'btrfs_uuid\') && _.isNull(disk.get("pool_name"))) { %>\n              <a href="#" class="btrfs_wipe" data-disk-name="<%= disk.get(\'name\') %>" title="Disk is unusable because it has BTRFS filesystem(s) on it. Click to wipe the disk." rel="tooltip"><i class="fa fa-eraser"></i></a> &nbsp\n              <a href="#" class="btrfs_import" data-disk-name="<%= disk.get(\'name\') %>" title="Click to import data(pools, shares and snapshots) on this disk automatically" rel="tooltip"><i class="icon-circle-arrow-down"></i></a>\n\n            <% } %>\n\n          </td>\n	  <td>\n	   <% if (disk.get(\'serial\') == null || disk.get(\'serial\') == \'\' || disk.get(\'serial\') == disk.get(\'name\')) { %>\n	      <div class="alert alert-error">\n       	      <h4>Warning! Disk serial number or UUID is not legitimate or unique.</h4>\n       	      Disk names may change unfavorably upon reboot, errors and replacement resulting in data loss. This error is caused by the source of these disks such as your Hypervisor or SAN. Please ensure that disks are provided with unique serial numbers before proceeding futher\n     	      </div>\n	    <% } else { %>\n	    <%= disk.get(\'serial\') %>\n	    <% if (disk.get(\'serial\')) { %>\n	    &nbsp;&nbsp;&nbsp;&nbsp;<a href="#disks/blink/<%= disk.get(\'name\') %>" title="A tool to physically identify the hard drive with this serial number" rel="tooltip"><i class="fa fa-lightbulb-o fa-lg"></i></a>&nbsp;\n            <% } %>\n	    <% } %>\n\n	   </td>\n          <td><%= humanize.filesize(disk.get(\'size\')*1024) %></td>\n          <td>\n            <% if (!_.isNull(disk.get("pool_name"))) { %>\n              <a href="#pools/<%= disk.get(\'pool_name\') %>">\n                <%= disk.get(\'pool_name\') %>\n              </a>\n            <% } %>\n          </td>\n	  <td><%= disk.get(\'model\') %></td>\n	  <td><%= disk.get(\'transport\') %></td>\n	  <td><%= disk.get(\'vendor\') %></td>\n        </tr>\n      <% }); %>\n    </tbody>\n  </table>\n  <div class="pagination-ph">\n  </div>\n<% } else { %>\n  <h4>No disks added. Click on Rescan to discover disks</h4>\n<% } %>\n');
