window.JST['network_edit_network'] = template('<script>\n/*\n * Copyright (c) 2012-2013 RockStor, Inc. <http://rockstor.com>\n * This file is part of RockStor.\n *\n * RockStor is free software; you can redistribute it and/or modify\n * it under the terms of the GNU General Public License as published\n * by the Free Software Foundation; either version 2 of the License,\n * or (at your option) any later version.\n *\n * RockStor is distributed in the hope that it will be useful, but\n * WITHOUT ANY WARRANTY; without even the implied warranty of\n * MERCHANTABILITY or FITNESS FOR A PARTICULAR PURPOSE.  See the GNU\n * General Public License for more details.\n *\n * You should have received a copy of the GNU General Public License\n * along with this program. If not, see <http://www.gnu.org/licenses/>.\n *\n */\n</script>\n\n<h3>Configure network interface <%= network.get(\'name\') %></h3>\n\n\n<div class="row-fluid">\n  <div class="span8">\n    <label class="control-label"></label>\n    <% if (network.get(\'itype\') == \'management\') { %>\n      <div class="alert alert-error">\n        <h4>Warning! You are editing the Rockstor administration interface.</h4>\n        You will lose connectivity to the old ip address and must access the web-ui at the new ip address.\n      </div>\n    <% } %>\n    <div class="form-box">\n      <form class="form-horizontal" id="edit-network-form" name="aform">\n        <div class="messages"></div>\n        <div class="control-group">\n          <label class="control-label" for="boot_proto">Configuration<span class="required"> *</span></label>\n          <div class="controls">\n            <select id="boot_proto" name="boot_proto">\n              <% if (network.get(\'boot_proto\') == \'dhcp\') { %>\n                <option value="dhcp" selected="selected">DHCP</option>\n              <% } else { %>\n                <option value="dhcp">DHCP</option>\n              <% } %>\n              <% if (network.get(\'boot_proto\') == \'static\') { %>\n                <option value="static" selected="selected">Static</option>\n              <% } else { %>\n                <option value="static">static</option>\n              <% } %>\n            </select>\n          </div>\n        </div>\n        <div class="control-group">\n          <label class="control-label" for="ipaddr">IP Address<span class="required"> *</span></label>\n          <div class="controls">\n            <% if (network.get(\'boot_proto\') == \'static\') { %>\n              <input type="text" id="ipaddr" name="ipaddr" value="<%= network.get(\'ipaddr\') %>" placeholder="IP Address" title="Enter IP Address" >\n            <% } else { %>\n              <input type="text" id="ipaddr" name="ipaddr" value="<%= network.get(\'ipaddr\') %>" placeholder="IP Address" title="ENter IP Address" disabled="disabled"  >\n            <% } %>\n          </div>\n        </div>\n        <div class="control-group">\n          <label class="control-label" for="netmask">Netmask<span class="required"> *</span></label>\n          <div class="controls">\n            <% if (network.get(\'boot_proto\') == \'static\') { %>\n              <input type="text" id="netmask" name="netmask" value="<%= network.get(\'netmask\') %>" placeholder="Netmask" title="Enter Netmask">\n            <% } else { %>\n              <input type="text" id="netmask" name="netmask" value="<%= network.get(\'netmask\') %>" placeholder="Netmask" title="Enter Netmak" disabled="disabled" >\n            <% } %>\n          </div>\n        </div>\n        <div class="control-group">\n          <label class="control-label" for="gateway">Gateway<span class="required"> *</span></label>\n          <div class="controls">\n            <% if (network.get(\'boot_proto\') == \'static\') { %>\n              <input type="text" id="gateway" name="gateway" value="<%= network.get(\'gateway\') %>" placeholder="Gateway" title="Enter Gateway">\n            <% } else { %>\n              <input type="text" id="gateway" name="gateway" value="<%= network.get(\'gateway\') %>" placeholder="Gateway" title="Enter Gateway" disabled="disabled" >\n            <% } %>\n          </div>\n        </div>\n        <div class="control-group">\n          <label class="control-label" for="domain">Domain<span class="required"> *</span></label>\n          <div class="controls">\n            <% if (network.get(\'boot_proto\') == \'static\') { %>\n              <input type="text" id="domain" name="domain" value="<%= network.get(\'domain\') %>" placeholder="Domain" title="Enter Domain">\n            <% } else { %>\n              <input type="text" id="domain" name="domain" value="<%= network.get(\'domain\') %>" placeholder="Domain" title="Enter Domain" disabled="disabled" >\n            <% } %>\n          </div>\n        </div>\n        <div class="control-group">\n          <label class="control-label" for="dns_servers">DNS Servers<span class="required"> *</span></label>\n          <div class="controls">\n            <% if (network.get(\'boot_proto\') == \'static\') { %>\n              <input type="text" id="dns_servers" name="dns_servers" value="<%= network.get(\'dns_servers\') %>" placeholder="DNS Servers" title="Enter comma separated list of dns server addresses">\n            <% } else { %>\n              <input type="text" id="dns_servers" name="dns_servers" value="<%= network.get(\'dns_servers\') %>" placeholder="DNS Servers" title="Enter comma separated list of dns server addresses" disabled="disabled" >\n            <% } %>\n          </div>\n        </div>\n        <div class="control-group">\n          <div class="controls">\n            <label class="checkbox">\n              <% if (network.get(\'itype\') == \'management\') { %>\n                <input class="checkbox inline" type="checkbox" id="itype" name="itype" placeholder="Management Interface" checked="checked">\n              <% } else { %>\n                <input class="checkbox inline" type="checkbox" id="itype" name="itype" placeholder="Management Interface" >\n              <% } %>\n              Allow RockStor administration through this interface\n            </label>\n          </div>\n        </div>\n        <div class="control-group">\n          <div class="controls">\n            <button type="Submit" id="submit" class="btn btn-primary">Submit</button>\n            <button id="cancel" class="btn">Cancel</button>\n          </div>\n        </div>\n      </form>\n    </div> <!-- form-box -->\n  </div> <!-- span8 -->\n</div> <!-- row-fluid -->\n');
