window.JST['nfs_edit_nfs_export'] = template('<script>\n/*\n * Copyright (c) 2012-2013 RockStor, Inc. <http://rockstor.com>\n * This file is part of RockStor.\n *\n * RockStor is free software; you can redistribute it and/or modify\n * it under the terms of the GNU General Public License as published\n * by the Free Software Foundation; either version 2 of the License,\n * or (at your option) any later version.\n *\n * RockStor is distributed in the hope that it will be useful, but\n * WITHOUT ANY WARRANTY; without even the implied warranty of\n * MERCHANTABILITY or FITNESS FOR A PARTICULAR PURPOSE.  See the GNU\n * General Public License for more details.\n *\n * You should have received a copy of the GNU General Public License\n * along with this program. If not, see <http://www.gnu.org/licenses/>.\n *\n */\n</script>\n\n\n<% if (nfsExportGroup.get(\'id\')>0) { %>\n<h3>Edit NFS export</h3>\n<%} else {%>\n<h3>Add NFS export</h3>\n<%}%>\n<div class="row-fluid">\n  <div class="span8">\n    <label class="control-label"></label>\n    <div class="form-box">\n      <form id="edit-nfs-export-form" name="aform" class="form-horizontal">\n        <div class="messages"></div>\n\n        <!-- Shares -->\n        <div class="control-group">\n          <label class="control-label" for="shares">Shares to export<span class="required"> *</span></label>\n          <div class="controls">\n            <select name="shares" id="shares" size="10" data-placeholder="Select shares to export" multiple>\n              <%\n                var nShares = _.map(nfsExportGroup.get(\'exports\'),\n                function(e) { return e.share; });\n              \n              %>\n              <% shares.each(function(share, index) { %>\n\n                <% if (_.indexOf(nShares, share.get(\'name\')) != -1) { %>\n                  <option value="<%= share.get(\'name\') %>" selected="selected"><%= share.get(\'name\') %></option>\n                <% } else { %>\n                  <option value="<%= share.get(\'name\') %>" ><%= share.get(\'name\') %></option>\n                <% } %>\n              <% }); %>\n            </select>\n          </div>\n        </div>\n\n        <!-- host string -->\n        <div class="control-group">\n          <label class="control-label" for="host_str">NFS Clients<span class="required"> *</span></label>\n          <div class="controls">\n            <input type="text" name="host_str" id="host_str"\n	    title="Hosts permitted to NFS mount. There are five broad categories of this input.<br><strong>anonymous:</strong> Just type a single * character and any host will be allowed.<br><strong>single host:</strong> Hostname or a IP address.<br><strong>IP networks:</strong> All hosts of a subnet given by <strong>address/netmask</strong>.<br><strong>wildcards:</strong> Names with wildcard(*, ?) characters for compact notation. for example, *.cs.foo.edu matches all hosts in the domain cs.food.edu.<br><strong>Netgroups:</strong> NIS netgroups given as @group.<br><br>For more details read the manpage for exports." value="<%= nfsExportGroup.get(\'host_str\') %>">\n          </div>\n        </div>\n\n	<!-- admin host -->\n	<div class="control-group">\n	  <label class="control-label" for="trusted_host">Admin\n	Host</span></label>\n	  <div class="controls">\n	    <input type="text" id="admin_host" name="admin_host"\n	title="Hostname or IP of a host to be designated as the admin host. The\n	export will be available for this host with rw and no_root_squash\n	options so that root user can change ownership and permissions of\n	various directories from this host. This is usually preferred in\n	conjunction with NIS.">\n	  </div>\n	</div>\n\n        <!-- writable -->\n        <div class="control-group">\n          <label class="control-label" for="mod_choice">Access type</label>\n          <div class="controls">\n            <% _.each(modify_choices, function(c) { %>\n              <label class="radio inline">\n                <% if (nfsExportGroup.get(\'editable\') == c.value) { %>\n                  <input type="radio" name="mod_choice" value="<%= c.value %>" checked="checked">\n                <% } else { %>\n                  <input type="radio" name="mod_choice" value="<%= c.value %>" >\n                <% } %>\n                <%= c.name %>\n              </label>\n            <% }); %>\n          </div>\n        </div>\n\n        <!-- sync -->\n        <div class="control-group">\n          <label class="control-label" for="sync_choice">Response type</label>\n          <div class="controls">\n            <% _.each(sync_choices, function(c) { %>\n              <label class="radio inline">\n                <% if (nfsExportGroup.get(\'syncable\') == c.value) { %>\n                  <input type="radio" name="sync_choice" value="<%= c.value %>" checked="checked">\n                <% } else { %>\n                  <input type="radio" name="sync_choice" value="<%= c.value %>" >\n                <% } %>\n                <%= c.name %>\n              </label>\n            <% }); %>\n          </div>\n        </div>\n\n        <!-- Submit -->\n        <div class="control-group">\n          <div class="controls">\n            <a id="cancel" class="btn">Cancel</a>\n            <input type="Submit" id="update-nfs-export" class="btn btn-primary" value="Submit"></input>\n          </div>\n        </div>\n\n      </form>\n    </div>\n  </div> <!-- span8 -->\n</div>  <!-- row-fluid -->\n');
window.JST['nfs_nfs_exports'] = template('<script>\n/*\n * Copyright (c) 2012-2013 RockStor, Inc. <http://rockstor.com>\n * This file is part of RockStor.\n *\n * RockStor is free software; you can redistribute it and/or modify\n * it under the terms of the GNU General Public License as published\n * by the Free Software Foundation; either version 2 of the License,\n * or (at your option) any later version.\n *\n * RockStor is distributed in the hope that it will be useful, but\n * WITHOUT ANY WARRANTY; without even the implied warranty of\n * MERCHANTABILITY or FITNESS FOR A PARTICULAR PURPOSE.  See the GNU\n * General Public License for more details.\n *\n * You should have received a copy of the GNU General Public License\n * along with this program. If not, see <http://www.gnu.org/licenses/>.\n *\n */\n</script>\n\n<!-- Module Body -->\n<div class="row-fluid">\n  <div class="span12">\n  <div id="details-header">\n      <table>\n        <tr>\n          <td><span class="h3">NFS Service&nbsp;&nbsp;&nbsp;</span></td>\n          <td>\n            <% if (service.get(\'status\')) { %>\n              <div class="slider-stop" data-service-name="<%= service.get(\'name\') %>">OFF</div>\n              <div class="slider-ph">\n                <input type="text" class="service-status" value="1" data-service-name="<%= service.get(\'name\') %>"></input>\n              </div>\n              <div class="slider-start on" data-service-name="<%= service.get(\'name\') %>">ON</div>\n            <% } else { %>\n              <div class="slider-stop" data-service-name="<%= service.get(\'name\') %>">OFF</div>\n              <div class="slider-ph">\n                <input type="text" class="service-status" value="0" data-service-name="<%= service.get(\'name\') %>"></input>\n              </div>\n              <div class="slider-start" data-service-name="<%= service.get(\'name\') %>">ON</div>\n            <% } %>\n            <div class="command-status" data-service-name="<%= service.get(\'name\') %>">&nbsp;</div>\n          </td>\n        </tr>\n      </table>\n    </div>\n    <div id="nfs-warning" class="alert" style="display:none">\n    	<strong>Warning! NFS Service is not running</strong>. Clients won\'t be able to mount unless NFS is running.\n    </div>\n    <br>\n    <div class="messages"></div>\n    <!-- Content -->\n    <% if (nfsExportGroups.length > 0) { %>\n      <table id="nfs-exports-table" class="table table-condensed table-bordered table-hover table-striped share-table tablesorter" summary="List of nfs exports">\n        <thead>\n          <tr>\n            <th scope="col" abbr="Host String">Host String</th>\n            <th scope="col" abbr="Shares">Shares</th>\n            <th scope="col" abbr="Writable">Writable</th>\n            <th scope="col" abbr="Sync">Sync / Async</th>\n            <th scope="col" abbr="Actions">Actions</th>\n          </tr>\n        </thead>\n        <tbody>\n          <% nfsExportGroups.each(function(n) { %>\n            <tr>\n              <td><%= n.get(\'host_str\') %></td>\n              <td>\n                <% _.each(n.get(\'exports\'), function(e, i) { %>\n                  <% if (i < (n.get(\'exports\').length - 1)) { %>\n                    <%= e.share %>,\n                  <% } else { %>\n                    <%= e.share %>\n                  <% } %>\n\n                <% }); %>\n              </td>\n              <td>\n                <% if (n.get(\'editable\') == \'rw\') { %>\n                  Writable\n                <% } else { %>\n                  Read-only\n                <% } %>\n              </td>\n              <td><%= n.get(\'syncable\') %></td>\n              <td>\n                <a href="#nfs-exports/edit/<%= n.id %>"><i class="icon-edit"></i></a>\n                &nbsp;\n                <a href="#" class="delete-nfs-export" data-id="<%= n.id %>"><i class="icon-trash"></i></a>\n              </td>\n            </tr>\n          <% }); %>\n        </tbody>\n      </table>\n      <div class="ph-pagination"></div>\n    <% } else { %>\n      <table id="nfs-exports-table" class="table table-condensed table-bordered table-hover table-striped share-table tablesorter" summary="List of nfs exports">\n        <tbody>\n          <tr>\n            <td colspan="5">\n              <h4>No nfs exports have been created</h4>\n            </td>\n          </tr>\n        </tbody>\n      </table>\n    <% } %>\n    <% if (nfsExportGroups.length > 0) { %>\n      Mount a share using <code>mount <%= currentAppliance.get(\'ip\') %>:/export/&lt;share_name&gt; &lt;mount_pt&gt;</code>\n    <% } %>\n    <!-- End Content -->\n  </div> <!-- span12 -->\n</div> <!-- row-fluid -->\n<br>\n<a href="##nfs-exports/edit/-1" id="add-nfs-export" class="btn btn-primary"><i class="icon-edit icon-white"></i> Add NFS Export</a>\n<a href="#nfs-advanced-edit" id="nfs-advanced-edit" title="Edit /etc/exports file directly" class="btn btn-primary"><i class="icon-edit icon-white"></i> Advanced Edit</a>\n<!-- end module body -->\n');
