window.JST['rockons_rockons'] = template('<script>\n/*\n * Copyright (c) 2012-2013 RockStor, Inc. <http://rockstor.com>\n * This file is part of RockStor.\n *\n * RockStor is free software; you can redistribute it and/or modify\n * it under the terms of the GNU General Public License as published\n * by the Free Software Foundation; either version 2 of the License,\n * or (at your option) any later version.\n *\n * RockStor is distributed in the hope that it will be useful, but\n * WITHOUT ANY WARRANTY; without even the implied warranty of\n * MERCHANTABILITY or FITNESS FOR A PARTICULAR PURPOSE.  See the GNU\n * General Public License for more details.\n *\n * You should have received a copy of the GNU General Public License\n * along with this program. If not, see <http://www.gnu.org/licenses/>.\n *\n */\n</script>\n\n<div class="messages"></div>\n\n<div class="pull-right">\n  <a id="js-update-rockons" class="btn btn-primary pull-right" href="#" title="Check for new Rock-ons"><i class="icon-refresh icon-white"></i> Update</a>\n</div>\n<span class="h2">Rock-ons</span>\n<br><br>\n\n<ul class="css-tabs">\n  <li class="active"><a href="#js-rockons-installed" data-toggle="tab">Installed</a></li>\n  <li><a href="#js-rockons-available" data-toggle="tab">All</a></li>\n</ul>\n\n\n<div class="css-panes">\n\n  <div>\n    <% var installed = 0; %>\n    <% rockons.each(function(rockon, index) { %>\n      <% if (rockon.get(\'state\') == \'installed\' || rockon.get(\'state\').match(\'pending\')) { %>\n      <% installed += 1; %>\n      <div id="js-rockons-installed" class="tab-section">\n	<div class="row-fluid">\n	  <div class="span6">\n	    <a href="<%= rockon.get(\'website\') %>" target="_blank"><h3><u><%= rockon.get(\'name\') %></u></h3></a>\n	    <p><%= rockon.get(\'description\') %></p>\n	    <h4>Current status: <%= rockon.get(\'status\') %></h4>\n\n	  </div>\n	  <div class="span3"></div>\n	  <div class="span3">\n	    <% if (rockon.get(\'state\') == \'installed\' && !rockon.get(\'status\').match(\'pending\')) { %>\n	      <div class="slider-stop" data-rockon-id="<%= rockon.get(\'id\') %>">OFF</div>\n	      <div class="slider-ph">\n		<% if (rockon.get(\'status\') == \'started\') { %>\n		  <input type="text" class="service-status" value="1" data-rockon-id="<%= rockon.get(\'id\') %>"></input>\n		<% } else { %>\n		  <input type="text" class="service-status" value="0" data-rockon-id="<%= rockon.get(\'id\') %>"></input>\n		<% } %>\n	      </div>\n	      <div class="slider-start on" data-rockon-id="<%= rockon.get(\'id\') %>">ON</div>&nbsp;&nbsp\n	      <a id="js-rockon-settings" href="#" class="settings" data-rockon-id="<%= rockon.get(\'id\') %>"><i class="icon-wrench"></i></a>\n	      <br><br>\n	      <% if (rockon.get(\'link\')) { %>\n	        <% var ui_link = "http://" + window.location.host + rockon.get(\'link\'); %>\n	        <a href="<%= ui_link %>" target="_blank" class="btn btn-primary">Open</a>\n	      <% } %>\n	      <a id="js-uninstall-rockon" class="btn btn-danger" data-name="<%= rockon.get(\'id\') %>">Uninstall</a>\n	    <% } else { %>\n	      <% if (rockon.get(\'state\').match(\'pending\') || rockon.get(\'status\').match(\'pending\')) { %>\n	        <p>Rockon is in transition state(<%= rockon.get(\'state\') %>/<%= rockon.get(\'status\') %>). Please wait...</p>\n	      <% } %>\n	      <a id="js-uninstall-rockon" class="btn btn-primary disabled" title="Rockon cannot be uninstalled because it is in a transition state(<%= rockon.get(\'state\') %>)">Uninstall</a>\n	    <% } %>\n	  </div>\n	</div>\n      </div>\n      <% } %>\n    <% }); %>\n    <% if (installed == 0) { %>\n      <div class="tab-section">\n	<div class="row-fluid">\n	  <div class="span12">\n	    <h3>There are no Rock-ons installed currently.</h3>\n	  </div>\n	</div>\n      </div>\n    <% } %>\n  </div>\n\n  <div id="js-rockons-available">\n    <% var all = 0; %>\n    <% rockons.each(function(rockon, index) { %>\n      <% if (rockon.get(\'state\') == \'available\' || rockon.get(\'state\') == \'install_failed\') { %>\n      <% all += 1; %>\n      <div class="tab-section">\n	<div class="row-fluid">\n	  <div class="span12">\n	    <a href="<%= rockon.get(\'website\') %>" target="_blank"><h3><%= rockon.get(\'name\') %></h3></a>\n	    <p><%= rockon.get(\'description\') %></p>\n	    <a id="js-install-rockon" class="btn btn-primary pull-right" href="#" data-name="<%= rockon.get(\'id\') %>">Install</a>\n	  </div>\n	</div>\n      </div>\n      <% } %>\n    <% }); %>\n    <% if (all == 0) { %>\n      <div class="tab-section">\n	<div class="row-fluid">\n	  <div class="span12">\n	    <h3>Click on Update button to check for new Rock-ons.</h3>\n	  </div>\n	</div>\n      </div>\n    <% } %>\n  </div>\n</div>\n\n\n<div class="simple-overlay" id="install-rockon-overlay">\n  <div class="overlay-content"></div>\n</div>\n\n<div id="install-rockon-modal" class="modal hide fade" tabindex="-1" role="dialog" aria-labelledby="myModalLabel" aria-hidden="true">\n  <div class="modal-header">\n    <button type="button" class="close" data-dismiss="modal" aria-hidden="true"></button>\n    <div id="install-rockon-modal-contents"></div>\n  </div>\n</div>\n');
window.JST['rockons_settings_summary'] = template('<div id="ph-settings-summary-table"></div>\n');
window.JST['rockons_settings_summary_table'] = template('<br>\n<table class="table table-condensed table-bordered table-hover table-striped tablesorter">\n<thead>\n  <tr>\n    <th>Resource type</th>\n    <th>Name/Value</th>\n  </tr>\n</thead>\n\n  <% volumes.each(function(volume, index) { %>\n    <tr>\n      <td>Share</td>\n      <td><%= volume.get(\'share_name\') %>&nbsp;&nbsp(<%= volume.get(\'dest_dir\') %>)</td>\n    </tr>\n  <% }); %>\n\n  <% for (share in new_volumes) { %>\n    <tr>\n      <td><i>Share</i></td>\n      <td><i><%= share %>&nbsp;&nbsp(<%= new_volumes[share] %>)</i></td>\n    </tr>\n  <% } %>\n\n  <% ports.each(function(port, index) { %>\n    <tr>\n      <td>Port</td>\n      <td><%= port.get(\'hostp\') %>&nbsp;&nbsp(<%= port.get(\'containerp\') %>)</td>\n    </tr>\n  <% }); %>\n\n  <% cc.each(function(cci, index) { %>\n    <tr>\n      <td>Custom</td>\n      <td><%= cci.get(\'val\') %>&nbsp;&nbsp(<%= cci.get(\'key\') %>)&nbsp;&nbsp<i class="fa fa-exclamation-circle" title="<%= cci.get(\'description\') %>" rel="tooltip"></i></td>\n    </tr>\n  <% }); %>\n</table>\n<% if (rockon.get(\'name\') == "OpenVPN" ) { %>\n  <h3>Additional steps are required by this Rockon.</h3>\n  <p>The following steps require you to open a terminal(eg: ssh) and execute commands as the root user.</p>\n  <h4><u>Initialize PKI</u></h4>\n  <p>This is required only once. Execute the following command as root</p>\n  <code>/opt/rockstor/bin/ovpn-initpki</code>\n  <br>\n  <h4><u>Generate a client certificate</u></h4>\n  <p>Generate a client certificate(one per client) without a passphrase by executing the following command as root.</p>\n  <code>/opt/rockstor/bin/ovpn-client-gen</code>\n  <br>\n  <h4><u>Retrieve client configuration</u></h4>\n  <p>\n    For each of your clients, retrieve the configuration by executing the\n    following command as root. The resulting .ovpn file can be used to connect.\n  </p>\n  <code>/opt/rockstor/bin/ovpn-client-print</code>\n<% } %>\n');
window.JST['rockons_summary_table'] = template('<table class="table table-condensed table-bordered table-hover table-striped tablesorter">\n<thead>\n  <tr>\n    <th>Resource type</th>\n    <th>Name/Value</th>\n  </tr>\n</thead>\n\n  <% for (s in share_map) { %>\n    <tr>\n      <td>Share</td>\n      <td><%= s %>&nbsp;&nbsp<i class="fa fa-exclamation-circle" title="<%= share_map[s] %>" rel="tooltip"></i></td>\n    </tr>\n  <% } %>\n\n  <% for (p in port_map) { %>\n    <tr>\n      <td>Port</td>\n      <td><%= p %>&nbsp;&nbsp<i class="fa fa-exclamation-circle" title="<%= port_map[p] %>" rel="tooltip"></i></td>\n    </tr>\n  <% } %>\n\n  <% for (c in cc_map) { %>\n    <tr>\n      <td>Custom</td>\n      <td><%= c %>&nbsp;&nbsp<i class="fa fa-exclamation-circle" title="<%= cc_map[c] %>" rel="tooltip"></i></td>\n    </tr>\n  <% } %>\n</table>\n');
