window.JST['samba_add_samba_export'] = template('<% if (sambaShareId!=null) { %>\n  <h3>Edit Samba export for <%= smbShare.get(\'share\') %></h3>\n<% } else {%>\n<h3>Add Samba export</h3>\n<% } %>\n<div class="row-fluid">\n  <div class="span8">\n    <label class="control-label"></label>\n    <div class="form-box">\n      <form id="add-samba-export-form" name="aform" class="form-horizontal">\n        <div class="messages"></div>\n\n        <!-- Shares -->\n        <div class="control-group">\n          <% if (sambaShareId == null) {  %>\n            <label class="control-label" for="shares">Shares to export<span class="required"> *</span></label>\n          <% } %>\n          <div class="controls">\n            <% if (sambaShareId == null) {  %>\n            <select name="shares" id="shares" size="10" data-placeholder="Select shares to export" multiple>\n            <% _.each(shares, function(share, index) { %>\n              <option value="<%= share.get(\'name\') %>" > <%= share.get(\'name\') %></option>\n            <% }); %>\n            </select>\n          <% } else { %>\n            <h4>Edit Samba Export for share: <strong><%= smbShare.get(\'share\') %></strong></h4>\n          <% } %>\n          </div>\n        </div>\n\n        <!-- Admin Users  -->\n        <div class="control-group">\n          <label class="control-label" for="admin_users">Admin users</label>\n          <div class="controls">\n            <select name="admin_users" id="admin_users" size="10" title="(optional) list of users who will be granted super-user privileges for all file operations." data-placeholder="Select admin user(s)" multiple>\n\n              <% users.each(function(user, index) {\n                  if (sambaShareId!=null && smbShare.get(\'admin_users\').length>0) {\n                   for(i=0; i< smbShare.get(\'admin_users\').length; i++){\n                      if(smbShare.get(\'admin_users\')[i].username == user.get("username")){ %>\n                         <option value="<%= user.get("username") %>" selected="selected"><%= user.get("username") %></option>\n                     <% } else{ %>\n                         <option value="<%= user.get("username") %>"><%= user.get("username") %></option>\n\n                     <% } } %>\n\n                     <% }else{ %>\n                        <option value="<%= user.get("username") %>"><%= user.get("username") %></option>\n\n                     <% }}); %>\n            </select>\n          </div>\n        </div>\n\n        <div class="control-group">\n          <label class="control-label" for="browsable">Browsable<span class="required"> *</span></label>\n          <div class="controls">\n              <% _.each(browsable_choices, function(c) { %>\n                <label class="radio inline">\n                 <% if (sambaShareId!=null){ %>\n                    <% if(c.value == smbShare.get("browsable")){ %>\n                        <input type="radio" name="browsable" value="<%= c.value %>" checked> <%= c.name %>\n                    <% }else{ %>\n                        <input type="radio" name="browsable" value="<%= c.value %>" > <%= c.name %>\n                    <% } %>\n                 <% }else { %>\n\n                   <% if(c.value == \'yes\'){ %>\n                      <input type="radio" name="browsable" value="<%= c.value %>" checked> <%= c.name %>\n                   <%  }else{ %>\n                      <input type="radio" name="browsable" value="<%= c.value %>" > <%= c.name %>\n                <%  } %>\n               <% } %>\n                </label>\n              <% }); %>\n          </div>\n        </div>\n\n        <div class="control-group">\n          <label class="control-label" for="guest_ok">Guest Ok<span class="required"> *</span></label>\n          <div class="controls">\n             <% _.each(guest_ok_choices, function(c) { %>\n                <label class="radio inline">\n                <% if (sambaShareId!=null){ %>\n                    <% if(c.value == smbShare.get("guest_ok")){ %>\n                        <input type="radio" name="guest_ok" value="<%= c.value %>" checked> <%= c.name %>\n                    <% }else{ %>\n                        <input type="radio" name="guest_ok" value="<%= c.value %>" > <%= c.name %>\n                    <% } %>\n                 <% }else { %>\n\n                   <% if(c.value == \'no\'){ %>\n                      <input type="radio" name="guest_ok" value="<%= c.value %>" checked> <%= c.name %>\n                   <%  }else{ %>\n                      <input type="radio" name="guest_ok" value="<%= c.value %>" > <%= c.name %>\n                <%  } %>\n               <% } %>\n              </label>\n              <% }); %>\n           </div>\n        </div>\n\n        <div class="control-group">\n          <label class="control-label" for="read_only">Read only<span class="required"> *</span></label>\n          <div class="controls">\n             <% _.each(read_only_choices, function(c) { %>\n                <label class="radio inline">\n                <% if (sambaShareId!=null){ %>\n                    <% if(c.value == smbShare.get("read_only")){ %>\n                        <input type="radio" name="read_only" value="<%= c.value %>" checked> <%= c.name %>\n                    <% }else{ %>\n                        <input type="radio" name="read_only" value="<%= c.value %>" > <%= c.name %>\n                    <% } %>\n                 <% }else { %>\n\n                   <% if(c.value == \'yes\'){ %>\n                      <input type="radio" name="read_only" value="<%= c.value %>" checked> <%= c.name %>\n                   <%  }else{ %>\n                      <input type="radio" name="read_only" value="<%= c.value %>" > <%= c.name %>\n                <%  } %>\n               <% } %>\n              </label>\n              <% }); %>\n           </div>\n        </div>\n\n        <div class="control-group">\n          <label class="control-label" for="comment">Comment</label>\n          <div class="controls">\n            <input type="text" id="comment" name="comment" value="Samba-Export" title="Comment string to associate with the new share">\n          </div>\n        </div>\n\n        <div class="control-group">\n          <label class="control-label" for="custom_config">Custom configuration </label>\n          <div class="controls">\n          <% if (sambaShareId!=null){ %>\n           <textarea id="custom_config" name="custom_config" rows="10" columns="40" class="span10" title="You can provide custom parameters here. These lines will be added to the section of each Share selected above in smb.conf"><%= configList %></textarea>\n           <% }else { %>\n           <textarea id="custom_config" name="custom_config" rows="10" columns="40" class="span10" title="You can provide custom parameters here. These lines will be added to the section of each Share selected above in smb.conf"></textarea>\n              <%  } %>\n        </div>\n\n      </div>\n        <div class="control-group">\n          <div class="controls">\n            <a id="cancel" class="btn">Cancel</a>\n            <input type="Submit" id="create-samba-export" class="btn btn-primary" value="Submit"></input>\n          </div>\n        </div>\n\n      </form>\n    </div>\n  </div>\n</div>\n');
window.JST['samba_samba'] = template('<!-- Module Body -->\n<div class="row-fluid">\n  <div class="span12">\n    <div id="details-header">\n      <table>\n        <tr>\n          <td><span class="h3">Samba Service&nbsp;&nbsp;&nbsp;</span></td>\n          <td>\n            <% if (service.get(\'status\')) { %>\n              <div class="slider-stop" data-service-name="<%= service.get(\'name\') %>">OFF</div>\n              <div class="slider-ph">\n                <input type="text" class="service-status" value="1" data-service-name="<%= service.get(\'name\') %>"></input>\n              </div>\n              <div class="slider-start on" data-service-name="<%= service.get(\'name\') %>">ON</div>\n            <% } else { %>\n              <div class="slider-stop" data-service-name="<%= service.get(\'name\') %>">OFF</div>\n              <div class="slider-ph">\n                <input type="text" class="service-status" value="0" data-service-name="<%= service.get(\'name\') %>"></input>\n              </div>\n              <div class="slider-start" data-service-name="<%= service.get(\'name\') %>">ON</div>\n            <% } %>\n            <div class="command-status" data-service-name="<%= service.get(\'name\') %>">&nbsp;</div>\n          </td>\n        </tr>\n      </table>\n    </div>\n    <div id="samba-warning" class="alert" style="display:none">\n    	<strong>Warning! Samba Service is not running</strong>. Clients won\'t be able to mount unless Samba is running.\n    </div>\n    <br>\n    <div class="messages"></div>\n    <!-- Content -->\n    <% if (collection.length > 0) { %>\n      <table id="samba-exports-table" class="table table-condensed table-bordered table-hover table-striped share-table tablesorter" summary="List of samba exports">\n        <thead>\n          <tr>\n            <th scope="col" abbr="Share name">Share</th>\n            <th scope="col" abbr="Browseable">Browseable</th>\n            <th scope="col" abbr="Guest ok">Guest ok</th>\n            <th scope="col" abbr="Read only">Read only</th>\n            <th scope="col" abbr="Admin Users">Admin Users</th>\n            <th scope="col" abbr="Comments">Comment</th>\n            <th scope="col" abbr="Actions">Actions</th>\n          </tr>\n        </thead>\n        <tbody>\n          <% collection.each(function(sambaShare) { %>\n            <tr>\n              <td><%= sambaShare.get(\'share\') %></td>\n              <td><%= sambaShare.get(\'browsable\') %></td>\n              <td><%= sambaShare.get(\'guest_ok\') %></td>\n              <td><%= sambaShare.get(\'read_only\') %></td>\n              <td>\n	      <% var userNames = _.reduce(sambaShare.get(\'admin_users\'), function(s, user, i, list) { if (i < (list.length-1)) { return s + user.username + \',\';} else { return s + user.username; } }, \'\'); %>\n	      <% if(userNames.length != 0){ %>\n	      <%= userNames %>\n	      <% }else {%>\n	      &nbsp;--\n	      <% } %>\n	      </td>\n              <td><%= sambaShare.get(\'comment\') %></td>\n              <td>\n	      <a href="#samba/edit/<%= sambaShare.id %>"><i class="icon-pencil"></i></a>\n	      &nbsp;\n                <a href="#" class="delete-samba-export" data-share="<%= sambaShare.get(\'share\') %>" data-id="<%= sambaShare.id %>"><i class="icon-trash"></i></a>\n              </td>\n            </tr>\n          <% }); %>\n        </tbody>\n      </table>\n    <% } else { %>\n      <table id="samba-exports-table" class="table table-condensed table-bordered table-hover table-striped share-table tablesorter" summary="List of samba exports">\n        <tbody>\n          <tr>\n            <td colspan="5">\n              <h4>No samba exports have been created</h4>\n            </td>\n          </tr>\n        </tbody>\n      </table>\n    <% } %>\n    <% if (freeShares.length > 0) { %>\n      <a href="#add-samba-export" id="add-samba-export" class="btn btn-primary"><i class="icon-edit icon-white"></i> Add Samba Export</a>\n    <% } else { %>\n      <a  id="add-samba-export" class="btn btn-primary disabled" title="No shares available to export through Samba"><i class="icon-edit icon-white"></i> Add Samba Export</a>\n    <% } %>\n  </div>\n</div>\n');
