window.JST['share_add_share_template'] = template('<script>\n/*\n * Copyright (c) 2012-2013 RockStor, Inc. <http://rockstor.com>\n * This file is part of RockStor.\n *\n * RockStor is free software; you can redistribute it and/or modify\n * it under the terms of the GNU General Public License as published\n * by the Free Software Foundation; either version 2 of the License,\n * or (at your option) any later version.\n *\n * RockStor is distributed in the hope that it will be useful, but\n * WITHOUT ANY WARRANTY; without even the implied warranty of\n * MERCHANTABILITY or FITNESS FOR A PARTICULAR PURPOSE.  See the GNU\n * General Public License for more details.\n *\n * You should have received a copy of the GNU General Public License\n * along with this program. If not, see <http://www.gnu.org/licenses/>.\n *\n */\n</script>\n\n\n<h3>Create Share</h3>\n\n<div class="row-fluid">\n  <div class="span12">\n    <label class="control-label"></label>\n    <div class="form-box">\n      <form class="form-horizontal" name="add-share-form" id="add-share-form">\n        <div class="messages"></div>\n        <div class="control-group">\n          <label class="control-label" for="share_name">Name<span class="required"> *</span></label>\n          <div class="controls">\n            <input type="text" name="share_name" id="share_name" title="Name of the Share must start with a letter(a-z) and can be followed by any of the following characters: letter(a-z), digits(0-9), hyphen(-), underscore(_) or a period(.).">\n          </div>\n        </div>\n        <div class="control-group">\n          <label class="control-label" for="pool_name">Pool<span class="required"> *</span></label>\n          <div class="controls">\n            <select id="pool_name" name="pool_name" title="Select pool the share should belong to">\n              <% if(poolName == \'\'){%>\n                <% pools.each(function(pool, index) { %>\n                  <% if (index > 0) { %>\n                    <option value="<%= pool.get(\'name\') %>"> <%= pool.get(\'name\') %> </option>\n                  <% } else{ %>\n                    <option value="<%= pool.get(\'name\') %>" selected="selected"> <%= pool.get(\'name\') %> </option>\n                  <% } %>\n                <% }); %>\n\n              <%} else { %>\n                <% pools.each(function(pool, index) { %>\n                  <% if (index >= 0) { %>\n                    <% if(poolName != pool.get(\'name\')){ %>\n                      <option value="<%= pool.get(\'name\') %>"> <%= pool.get(\'name\') %> </option>\n                    <% }else{ %>\n                      <option value="<%= pool.get(\'name\') %>" selected="selected"> <%= pool.get(\'name\') %> </option>\n\n                    <% } %>\n                  <% } %>\n                <% }); %>\n              <% } %>\n\n            </select>\n          </div>\n        </div>\n	<div class="control-group">\n          <label class="control-label" for="compression">Compression</label>\n          <div class="controls">\n            <select id="compression" name="compression">\n              <option value="no">Inherit from pool wide configuration</option>\n              <option value="zlib">zlib</option>\n              <option value="lzo">lzo</option>\n            </select>\n          </div>\n        </div>\n        <div class="control-group">\n          <label class="control-label" for="share_size">Size<span class="required"> *</span></label>\n          <div class="controls">\n            <div id="slider" style="width: 400px; float: left;"></div>\n            <input type="text" style="margin-top: 16px;" class="span2" name="share_size" id="share_size" title="Enter share size in GB or TB">\n          </div>\n        </div>\n        <div class="control-group">\n          <div class="controls slider-legend">\n            <div style="width: 15px; height: 15px; float: left" class="slider-legend-free"></div> <div>&nbsp;<span id="legend-free-num"></span>&nbsp;Space that is completely free and unprovisioned</div>\n            <br>\n            <div style="width: 15px; height: 15px; float: left" class="slider-legend-reclaimable"></div> <div>&nbsp;<span id="legend-reclaimable-num"></span>Space that is provisioned for other shares, but currently free</div>\n            <br>\n            <div style="width: 15px; height: 15px; float: left" class="slider-legend-used"> </div><div>&nbsp;<span id="legend-used-num"></span>Space that is provisioned for other shares and is in use</div>\n          </div>\n        </div>\n        <div class="control-group">\n          <div class="controls">\n            <a id="js-cancel" class="btn">Cancel</a>\n            <input type="Submit" id="create_share" class="btn btn-primary" value="Submit"></input>\n          </div>\n        </div>\n      </form>\n    </div> <!-- form-box -->\n  </div> <!-- span8 -->\n</div> <!-- row-fluid -->\n');
