window.JST['share_smb_share_edit'] = template('<h4>Add SMB Share</h4>\n<div class="row-fluid">\n  <div class="span8">\n    <div id="smb-form-container" class="form-box">\n      <form id="add-smb-form" name="aform">\n        <div class="messages"></div>\n\n        <div class="control-group">\n          <label class="control-label" for="admin_users">Admin users</span></label>\n          <div class="controls">\n            <input type="text" id="admin_users" name="admin_users" title="Enter a <strong>space separated list of users</strong> who will be granted administrative privileges on the share. <br><strong>This means that they will do all file operations as the super-user (root). You should use this option very carefully, as any user in this list will be able to do anything they like on the share, irrespective of file permissions.</strong>">\n          </div>\n        </div>\n        \n        <div class="control-group">\n          <label class="control-label" for="browsable">Browsable</label>\n          <div class="controls">\n            <select id="browsable" name="browsable" title="Allows share to be displayed in list of machine resources">\n              <% _.each(browsable_choices, function(c) { %>\n                <option value="<%= c.value %>"><%= c.name %></option>\n              <% }); %>\n            </select>\n          </div>\n        </div>\n\n        <div class="control-group">\n          <label class="control-label" for="guest_ok">Guest Ok</label>\n          <div class="controls">\n            <select id="guest_ok" name="guest_ok" title="Is default guest user access allowed?">\n              <% _.each(guest_ok_choices, function(c) { %>\n                <option value="<%= c.value %>"><%= c.name %></option>\n              <% }); %>\n            </select>\n          </div>\n        </div>\n\n        <div class="control-group">\n          <label class="control-label" for="read_only">Read Only</label>\n          <div class="controls">\n            <select id="read_only" name="read_only" title="Is the share read-only or writable">\n              <% _.each(read_only_choices, function(c) { %>\n                <option value="<%= c.value %>"><%= c.name %></option>\n              <% }); %>\n            </select>\n          </div>\n        </div>\n\n        <div class="control-group">\n          <label class="control-label" for="comment">Comment</label>\n          <div class="controls">\n            <input type="text" id="comment" name="comment" title="Comment string to associate with the new share">\n          </div>\n\n          <div class="control-group">\n            <div class="controls">\n              <button class="btn" id="cancel-smb">Cancel</button>\n              <input type="Submit" value="Submit" class="btn btn-primary" id="save-smb"></input>\n            </div>\n          </div>\n        </form>\n      </div>        \n    </div>\n  </div>\n</div>\n');
