window.JST['share_smb_shares_template'] = template('<script>\n/*\n * Copyright (c) 2012-2013 RockStor, Inc. <http://rockstor.com>\n * This file is part of RockStor.\n * \n * RockStor is free software; you can redistribute it and/or modify\n * it under the terms of the GNU General Public License as published\n * by the Free Software Foundation; either version 2 of the License,\n * or (at your option) any later version.\n * \n * RockStor is distributed in the hope that it will be useful, but\n * WITHOUT ANY WARRANTY; without even the implied warranty of\n * MERCHANTABILITY or FITNESS FOR A PARTICULAR PURPOSE.  See the GNU\n * General Public License for more details.\n * \n * You should have received a copy of the GNU General Public License\n * along with this program. If not, see <http://www.gnu.org/licenses/>.\n * \n */\n</script>\n\n\n<% if (!_.isUndefined(smbShare.id)) { %>\n  <table id="smb-shares-table" summary="SMB Share">\n    <tbody id="smb-shares-table-body">\n      <tr>\n        <td>Browsable: </td><td><%= smbShare.get("browsable") %></td>\n      </tr>\n      <tr>\n        <td>Guest ok: </td><td><%= smbShare.get(\'guest_ok\') %></td>\n      </tr>\n      <tr>\n        <td>Read only: </td><td><%= smbShare.get(\'read_only\') %></td>\n      </tr>\n      <tr>\n        <td>Admin users: </td><td><%= smbShare.get(\'admin_users\') %></td>\n      </tr>\n      <tr>\n        <td>Comments: </td><td><%= smbShare.get(\'comment\') %></td>\n      </tr>\n    </tbody>\n  </table>\n<% } else { %>\n  <div class="alert"><h4>No Samba export created for this share.  To add a Samba export, go to the <a href="#samba-exports">Samba</a> page.</div>\n  <br/>\n  <br/>\n<% } %>\n\n');
window.JST['share_snapshot_add'] = template('<script>\n/*\n * Copyright (c) 2012-2013 RockStor, Inc. <http://rockstor.com>\n * This file is part of RockStor.\n *\n * RockStor is free software; you can redistribute it and/or modify\n * it under the terms of the GNU General Public License as published\n * by the Free Software Foundation; either version 2 of the License,\n * or (at your option) any later version.\n *\n * RockStor is distributed in the hope that it will be useful, but\n * WITHOUT ANY WARRANTY; without even the implied warranty of\n * MERCHANTABILITY or FITNESS FOR A PARTICULAR PURPOSE.  See the GNU\n * General Public License for more details.\n *\n * You should have received a copy of the GNU General Public License\n * along with this program. If not, see <http://www.gnu.org/licenses/>.\n *\n */\n</script>\n\n<h4>Create Snapshot</h4>\n\n<div class="row-fluid">\n  <div class="span8">\n    <label class="control-label"></label>\n    <div class="form-box">\n      <form name="add-snapshot-form" id="add-snapshot-form" class="form-horizontal">\n        <div class="messages"></div>\n\n        <div class="control-group">\n          <label class="control-label" for="snapshot-name">Name<span class="required"> *</span></label>\n          <div class="controls">\n            <input type="text" name="snapshot-name" id="snapshot-name" title="Name of the Snapshot must start with a letter(a-z) and can be followed by any of the following characters: letter(a-z), digits(0-9), hyphen(-), underscore(_) or a period(.).">\n          </div>\n        </div>\n\n        <div class="control-group">\n          <label class="control-label" for=writable">Writable<span class="required"> *</span></label>\n          <div class="controls">\n             <% _.each(modify_choices, function(c) { %>\n                <label class="radio inline">\n                   <% if(c.value == \'yes\'){ %>\n                      <input type="radio" name="writable" value="rw" checked> <%= c.name %>\n                   <%  }else{ %>\n                      <input type="radio" name="writable" value="ro" title="Note that (1)read-only snapshots cannot be cloned and (2)Shares cannot be rolled back to read-only snapshots" > <%= c.name %>\n                <%  } %>\n               </label>\n              <% }); %>\n           </div>\n        </div>\n\n\n       <div class="control-group">\n          <label class="control-label" for="snapshot-visible"> </label>\n          <div class="controls">\n            <input type="checkbox" name="uvisible" id="snapshot-visible" title="Snapshots can be visible or hidden to the end user of the Share"> Visible to user?\n          </div>\n        </div>\n\n        <div class="control-group">\n          <div class="controls">\n            <a class="btn" href="#" id="js-snapshot-cancel"> Cancel</a>\n            <input type="Submit" class="btn btn-primary" value="Submit" id="js-snapshot-save"></input>\n          </div>\n        </div>\n\n      </form>\n    </div>\n  </div>\n</div>\n');
window.JST['share_snapshots_table_template'] = template('<script>\n/*\n * Copyright (c) 2012-2013 RockStor, Inc. <http://rockstor.com>\n * This file is part of RockStor.\n *\n * RockStor is free software; you can redistribute it and/or modify\n * it under the terms of the GNU General Public License as published\n * by the Free Software Foundation; either version 2 of the License,\n * or (at your option) any later version.\n *\n * RockStor is distributed in the hope that it will be useful, but\n * WITHOUT ANY WARRANTY; without even the implied warranty of\n * MERCHANTABILITY or FITNESS FOR A PARTICULAR PURPOSE.  See the GNU\n * General Public License for more details.\n *\n * You should have received a copy of the GNU General Public License\n * along with this program. If not, see <http://www.gnu.org/licenses/>.\n *\n */\n</script>\n<div class="messages"></div>\n<% if (!snapshots.isEmpty()) { %>\n  <table id="snapshots-table" class="table table-condensed table-bordered table-hover table-striped share-table tablesorter" summary="List of snapshots">\n    <thead>\n      <tr>\n        <th>\n          <input class="js-snapshot-select-all inline" type="checkbox" name="snapshot-select-all" ></input>\n        </th>\n        <th>Name</th>\n        <th>Created on</th>\n        <th>Visibility to user</th>\n        <th>Writable</th>\n        <th>Total Size</th>\n	    <th>Exclusive Size</th>\n        <th>Actions</th>\n      </tr>\n    </thead>\n    <tbody>\n      <% snapshots.each(function(snapshot, index) { %>\n        <tr>\n          <td>\n            <% if (RockstorUtil.listContains(selectedSnapshots, \'name\', snapshot.get(\'name\'))) { %>\n              <input class="js-snapshot-select inline" type="checkbox" name="snapshot-select" data-name="<%= snapshot.get(\'name\') %>" data-id="<%= snapshot.get(\'id\') %>" checked="checked"></input>\n            <% } else { %>\n              <input class="js-snapshot-select inline" type="checkbox" name="snapshot-select" data-name="<%= snapshot.get(\'name\') %>" data-id="<%= snapshot.get(\'id\') %>" ></input>\n            <% } %>\n          </td>\n          <td><i class="icon-camera"></i> <%= snapshot.get(\'name\') %></td>\n          <td><%= moment(snapshot.get("toc")).format(RS_DATE_FORMAT) %></td>\n          <td>\n            <% if (snapshot.get("uvisible")) { %>\n              Visible\n            <% } else { %>\n              Hidden\n            <% } %>\n          </td>\n          <td>\n            <% if (snapshot.get("writable")) { %>\n              Yes\n            <% } else { %>\n              No\n            <% } %>\n          </td>\n          <td><%= humanize.filesize(snapshot.get(\'r_usage\')*1024) %></td>\n	        <td><%= humanize.filesize(snapshot.get(\'e_usage\')*1024) %></td>\n          <td>\n	  <% if (snapshot.get("writable")) { %>\n            <a class="js-snapshot-clone" href="#" data-name="<%= snapshot.get(\'name\') %>"><i rel="tooltip" title="Clone snapshot" class="icon-book"></i></a>\n	    <% } %>\n            <a href="#" class="js-snapshot-delete" id="delete_snapshot_<%=snapshot.get(\'name\') %>" data-name="<%= snapshot.get(\'name\') %>" data-size="<%= humanize.filesize(snapshot.get(\'e_usage\')*1024) %>" data-share-name="<%= share.get(\'name\') %>" data-action="delete" title="Delete snapshot"><i rel="tooltip" title="Delete snapshot" class="icon-trash"></i></a>\n          </td>\n        </tr>\n	  <% }); %>\n    </tbody>\n\n  </table>\n<div class="pagination-ph"></div>\n<% } else { %>\n  <div class="alert"><h4>There are no snapshots to display</h4></div>\n<% } %>\n<div class="row-fluid">\n  <div class="pull-right">\n    <% if (!snapshots.isEmpty()) { %>\n      <a class="btn btn-danger" href="#" id="js-snapshot-delete-multiple"><i class="icon-trash icon-white"></i> Delete</a>\n    <% } %>\n    <a class="btn btn-primary" href="#" id="js-snapshot-add"><i class="icon-edit icon-white"></i> Create snapshot</a>\n  </div>\n</div>\n');
