window.JST['support_support_table_template'] = template('<script>\n/*\n * Copyright (c) 2012-2013 RockStor, Inc. <http://rockstor.com>\n * This file is part of RockStor.\n * \n * RockStor is free software; you can redistribute it and/or modify\n * it under the terms of the GNU General Public License as published\n * by the Free Software Foundation; either version 2 of the License,\n * or (at your option) any later version.\n * \n * RockStor is distributed in the hope that it will be useful, but\n * WITHOUT ANY WARRANTY; without even the implied warranty of\n * MERCHANTABILITY or FITNESS FOR A PARTICULAR PURPOSE.  See the GNU\n * General Public License for more details.\n * \n * You should have received a copy of the GNU General Public License\n * along with this program. If not, see <http://www.gnu.org/licenses/>.\n * \n */\n</script>\n\n\n<!-- Header -->\n<div class="row-fluid">\n  <div class="span12">\n    <div class="module-header">\n      <div class="title"><span class="h3">Support Cases</span></div>\n    </div>\n  </div> <!-- span12 -->\n</div> <!-- row-fluid -->\n\n<!-- Module Body -->\n<div class="row-fluid">\n  <div class="span12">\n    <% if (!support.isEmpty()) { %>\n      <table id="support-table" class="table table-condensed table-bordered table-hover table-striped share-table tablesorter" summary="List of support Cases">\n        <thead>\n          <tr>\n            <th>No.</th>\n            <th>CaseId</th>\n            <th>Type</th>\n            <th>Notes</th>\n            \n          </tr>\n        </thead>\n        <tbody>\n          <% support.each(function(supportCase, index) { %>\n            <tr>\n              <td><%= index+1 %></td>\n              <td><a href="#support/<%= supportCase.get(\'id\') %>"><%= supportCase.get(\'id\') %></a></td>\n              <td><%= supportCase.get(\'case_type\') %></td>\n              <td><%= supportCase.get(\'notes\') %></td>\n              \n            </tr>\n          <% }); %>\n        </tbody>\n      </table>\n    <% } else { %>\n      <h4>No support cases have been created.</h4>\n    <% } %>\n    <a href="#add_support_case" id="add_support_case" class="btn btn-primary">Create Support Case</a>\n  </div> <!-- span12 -->\n</div> <!-- row-fluid -->\n');
