window.JST['update_version_info'] = template('<h3>You are currently running RockStor <%= currentVersion %></h3>\n<% if (currentVersion != mostRecentVersion) { %>\n  <br>\n  <h3>A new update is available!</h3>\n  <span class="h3">RockStor <%= mostRecentVersion %></span>&nbsp;&nbsp;&nbsp;&nbsp;\n  <!-- <a id="update" class="btn btn-primary" title="Update">Update</a> -->\n  <br>\n  <br>\n  <h4>Here are the changes with this update</h4>\n  <ul>\n    <% _.each(changeList, function(item) { %>\n      <li><h4><%= item %></h4></li>\n    <% }); %>\n  </ul>\n  <div class="row-fluid">\n    <div class="span6">\n      <div class="alert alert-success" id="contrib-alert">\n      <h4>We are happy to make this update available to you.<br>Will you help support Rockstor development with a generous donation?<br><br></h4>\n	<label class="radio inline">\n	  <input type="radio" name="contrib" id="contrib10" value="10" checked>$10\n	</label>\n        <label class="radio inline">\n          <input type="radio" name="contrib" id="contrib20" value="20">$20\n        </label>\n        <label class="radio inline">\n          <input type="radio" name="contrib" id="contrib30" value="30">$30\n        </label>\n	<label class="radio inline">\n	  <input type="radio" name="contrib" id="contrib50" value="50">$50\n	</label>\n        <label class="radio inline">\n          <input type="radio" name="contrib" id="contrib-custom" value="custom">Other\n        </label>\n        &nbsp;<input class="span4" id="custom-amount" name="custom-amount" placeholder="Enter amount" style="display: none">\n        <br>\n        <br>\n        <a id="donateYes" class="btn btn-primary" title="Update">Yes, I\'ll support Rockstor</a>\n      </div>\n    </div>\n  </div>\n  <a id="donateNo" class="btn" title="Update">No, just update </a>\n  </p>\n<% } else { %>\n  <p>Rockstor is up-to-date. If you\'ve updated recently, reload the browser<b>(Ctrl+Shift+R)</b> for latest UI changes.</p><br>\n\n  <% if (autoUpdateEnabled) { %>\n  <p>Rockstor is configured to check for updates once a day and automatically update itself. If you so choose, you can disable auto update.</p>\n  <a id="disableAuto" class="btn btn-primary" title="Disable Auto Update">Disable auto update</a>\n  <% } else { %>\n  <p>Rockstor can be configured to check for updates once a day and automatically update itself. We recommend you enable auto update.</p>\n  <a id="enableAuto" class="btn btn-primary" title="Enable Auto Update">Enable auto update</a>\n  <% } %>\n<% } %>\n\n<div id="update-modal" class="modal hide fade" tabindex="-1" role="dialog" aria-labelledby="updateModalLabel" aria-hidden="true">\n  <div class="modal-header">\n    <h3 id="updateModalLabel">RockStor Update</h3>\n  </div>\n  <div class="modal-body">\n    <h4>RockStor is being updated to the latest version. Please wait... &nbsp;&nbsp; </h4>\n    <br>\n    <div style="text-align: center">\n      <img src="/static/storageadmin/img/ajax-loader-big.gif">\n      <div id="time-left"></div>\n    </div>\n    <div id="user-msg" style="display: none">The Rockstor update is still going on. if the page does not automatically refresh after a few minutes, please try manually refreshing after some time.</div>\n  </div>\n</div>\n\n<form id="contrib-form" action="https://www.paypal.com/cgi-bin/webscr" method="post" target="_blank"i style="display:none">\n  <input type="hidden" name="cmd" value="_xclick" />\n  <input type="hidden" name="business" value="WUDA5UNJXDCZ8" />\n  <input type="hidden" name="currency_code" value="USD" />\n  <input type="hidden" name="item_name" value="Support Rockstor development" />\n  <input type="hidden" name="amount" value="10" />\n  <input type="hidden" name="cn" value="Note to Rockstor developers" />\n  <input type="hidden" name="no_shipping" value="1" />\n</form>\n');
window.JST['users_add_group'] = template('<script>\n  /*\n  * Copyright (c) 2012-2013 RockStor, Inc. <http://rockstor.com>\n  * This file is part of RockStor.\n  *\n  * RockStor is free software; you can redistribute it and/or modify\n  * it under the terms of the GNU General Public License as published\n  * by the Free Software Foundation; either version 2 of the License,\n  * or (at your option) any later version.\n  *\n  * RockStor is distributed in the hope that it will be useful, but\n  * WITHOUT ANY WARRANTY; without even the implied warranty of\n  * MERCHANTABILITY or FITNESS FOR A PARTICULAR PURPOSE.  See the GNU\n  * General Public License for more details.\n  *\n  * You should have received a copy of the GNU General Public License\n  * along with this program. If not, see <http://www.gnu.org/licenses/>.\n  *\n  */\n</script>\n<% if (groupname == null) { %>\n<h3>Create a new group</h3>\n<%} else {%>\n<h3>Edit Group</h3>\n<%}%>\n<div class="row-fluid">\n  <div class="span8">\n    <div class="form-box">\n      <form id="group-create-form" name="aform" class="form-horizontal">\n\n        <div class="messages"></div>\n        <div class="control-group">\n          <label class="control-label" for="groupname">Groupname\n          <% if (groupname == null) { %>\n          <span class="required"> *</span>\n          <% } %>\n          </label>\n          <div class="controls">\n          <% if (groupname != null) { %>\n            <label class="control-label" style="text-align:left"><%=groupname%></label>\n            <input type="hidden" id="groupname" name="groupname" value="<%=groupname%>">\n          <% } else { %>\n            <input type="text" id="groupname" name="groupname" placeholder="Groupname" title="Enter Group Name">\n          <% } %>\n          </div>\n        </div>\n        <div class="control-group">\n          <div class="controls">\n            <label class="checkbox">\n            <% if (group != null && group.get(\'admin\')) { %>\n                <input class="checkbox inline" type="checkbox" id="admin" name="admin" placeholder="Admin" checked="true">\n              <% } else { %>\n                <input class="checkbox inline" type="checkbox" id="admin" name="admin" placeholder="Admin">\n              <% } %>\n              Put this group under Rockstor management?\n            </label>\n          </div>\n        </div>\n	<div class="control-group">\n	<label class="control-label">GID</label>\n	  <div class="controls">\n	    <input type="text" id="gid" name="gid" placeholder="Autogenerate" title="Enter a custom gid here or one will be autogenerated">\n	  </div>\n	</div>\n        <div class="control-group">\n          <div class="controls">\n            <button id="cancel" class="btn">Cancel</button>\n            <button type="Submit" id="create-group" class="btn btn-primary">Submit</button>\n          </div>\n        </div>\n\n      </form>\n    </div>\n  </div>\n</div>\n');
window.JST['users_add_user'] = template('<script>\n  /*\n  * Copyright (c) 2012-2013 RockStor, Inc. <http://rockstor.com>\n  * This file is part of RockStor.\n  *\n  * RockStor is free software; you can redistribute it and/or modify\n  * it under the terms of the GNU General Public License as published\n  * by the Free Software Foundation; either version 2 of the License,\n  * or (at your option) any later version.\n  *\n  * RockStor is distributed in the hope that it will be useful, but\n  * WITHOUT ANY WARRANTY; without even the implied warranty of\n  * MERCHANTABILITY or FITNESS FOR A PARTICULAR PURPOSE.  See the GNU\n  * General Public License for more details.\n  *\n  * You should have received a copy of the GNU General Public License\n  * along with this program. If not, see <http://www.gnu.org/licenses/>.\n  *\n  */\n</script>\n<% if (username == null) { %>\n<h3>Create a new user</h3>\n<%} else {%>\n<h3>Edit User</h3>\n<%}%>\n<div class="row-fluid">\n  <div class="span8">\n\n    <label class="control-label"></label>\n\n    <div class="form-box">\n      <form id="user-create-form" name="aform" class="form-horizontal">\n\n        <div class="messages"></div>\n        <div class="control-group">\n	  <% if (username != null) { %>\n          <label class="control-label" for="username">Username (UID)\n	  <% } else { %>\n	  <label class="control-label" for="username">Username\n	  <% } %>\n          <% if (username == null) { %>\n          <span class="required"> *</span>\n          <% } %>\n          </label>\n          <div class="controls">\n          <% if (username != null) { %>\n            <label class="control-label" style="text-align:left"><%=username%>        (<%=user.get(\'uid\')%>)</label>\n            <input type="hidden" id="username" name="username" value="<%=username%>">\n          <% } else { %>\n            <input type="text" id="username" name="username" placeholder="Username" title="Username must start with a letter and can contain letters, numbers, - and _ characters. It cannot exceed 30 characters in length.">\n          <% } %>\n          </div>\n        </div>\n        <div class="control-group">\n          <div class="controls">\n            <label class="checkbox">\n            <% if (user != null && user.get(\'user\')) { %>\n                <input class="checkbox inline" type="checkbox" id="admin" name="admin" placeholder="Admin" checked="true">\n              <% } else { %>\n                <input class="checkbox inline" type="checkbox" id="admin" name="admin" placeholder="Admin">\n              <% } %>\n              Allow this user to login to RockStor Web UI?\n            </label>\n          </div>\n        </div>\n        <div class="control-group">\n	  <% if (username == null) { %>\n            <label class="control-label">Password<span class="required"> *</span></label>\n	  <% } else { %>\n	    <label class="control-label">Password<span class="required"></span></label>\n	  <% } %>\n          <div class="controls">\n            <input type="password" id="password" name="password" placeholder="Password">\n          </div>\n        </div>\n        <div class="control-group">\n	  <% if (username == null) { %>\n            <label class="control-label">Confirm Password<span class="required"> *</span></label>\n	  <% } else { %>\n	    <label class="control-label">Confirm Password<span class="required"></span></label>\n	  <% } %>\n          <div class="controls">\n            <input type="password" id="password_confirmation" name="password_confirmation" placeholder="Password">\n          </div>\n        </div>\n        <div class="control-group">\n        <label class="control-label">Public key</label>\n          <div class="controls">\n             <% if ((username != null) && (user.get("public_key") != null)) { %>\n             <textarea rows="1" cols="50" id="public_key" name="public_key"> <%= user.get("public_key") %> </textarea>\n             <% } else { %>\n             <textarea id="public_key" name="public_key" />\n             <% } %>\n          </div>\n        </div>\n	<% shells = [\'/bin/bash\', \'/sbin/nologin\']; %>\n	<div class="control-group">\n	  <label class="control-label" for="shell">Login shell<span class="required"></span></label>\n	  <div class="controls">\n	    <select id="shell" name="shell">\n        <% _.each(shells, function(s, index) { %>\n          <% if (user.get(\'shell\') == s) { %>\n            <option value="<%= s %>" selected="selected"><%= s %> </option>\n          <% } else { %>\n            <option value="<%= s %>"><%= s %> </option>\n          <% } %>\n	      <% }); %>\n	    </select>\n	  </div>\n	</div>\n	<% if (username == null) { %>\n	<div class="control-group">\n	<label class="control-label">UID</label>\n	  <div class="controls">\n	    <input type="text" id="uid" name="uid" placeholder="Create a new one" title="Enter a custom uid here or one will be autogenerated">\n	  </div>\n	</div>\n	<% } %>\n	<% if (username == null) { %>\n	<div class="control-group">\n	<label class="control-label">Group</label>\n	  <div class="controls">\n	    <select name="group" id="group" title="Select a primary group from the list of one will be autogenerated" data-placeholder="Autogenerate">\n	    <option value="Autogenerate" selected="selected">Create a new one</option>\n      <% groups.each(function(group, index) { %>\n          <option value="<%= group.get(\'groupname\') %>"><%= group.get(\'groupname\') %></option>\n	    <% }); %>\n	    </select>\n	  </div>\n	</div>\n        <% } %>\n	<div class="control-group">\n	<label class="control-label">Email</label>\n	  <div class="controls">\n	    <input type="text" id="email" name="email" title="Enter an email address to associate with the user">\n	  </div>\n	</div>\n        <div class="control-group">\n          <div class="controls">\n            <button id="cancel" class="btn">Cancel</button>\n            <button type="Submit" id="create-user" class="btn btn-primary">Submit</button>\n          </div>\n        </div>\n\n      </form>\n    </div>\n  </div>\n</div>\n');
